const bl = clamp(effect('Rectangle Independent Corners')('bl'), 0, minSize);
const dropdown = effect('Rectangle Independent Corners')('Align').value;
const [ox, oy] = [
    [
        0,
        0
    ],
    [
        -w / 2,
        0
    ],
    [
        -w,
        0
    ],
    [
        -w,
        -h / 2
    ],
    [
        -w,
        -h
    ],
    [
        -w / 2,
        -h
    ],
    [
        0,
        -h
    ],
    [
        0,
        -h / 2
    ],
    [
        -w / 2,
        -h / 2
    ]
][dropdown - 1];
$bm_rt = createPath([
    [
        $bm_sum(ox, 0),
        $bm_sum(oy, tl)
    ],
    [
        $bm_sum(ox, tl),
        $bm_sum(oy, 0)
    ],
    [
        $bm_sub($bm_sum(ox, w), tr),
        $bm_sum(oy, 0)
