    [
        $bm_sum(ox, bl),
        $bm_sum(oy, h)
    ],
    [
        $bm_sum(ox, 0),
        $bm_sub($bm_sum(oy, h), bl)
    ]
], [
    [
        0,
        0
    ],
    [
        $bm_mul($bm_neg(tl), tanScale),
        0
    ],
    [
        0,
        0
    ],
    [
        0,
        $bm_mul($bm_neg(tr), tanScale)
    ],
    [
        0,
        0
    ],
    [
        $bm_mul(br, tanScale),
        0
    ],
    [
        0,
        0
    ],
    [
        0,
        $bm_mul(bl, tanScale)
    ]
], [
    [
        0,
        $bm_mul($bm_neg(tl), tanScale)
    ],
    [
        0,
        0
    ],
    [
        $bm_mul(tr, tanScale),
        0
    ],
    [
        0,
        0
    ],
    [
        0,
        $bm_mul(br, tanScale)
    ],
    [
        0,
        0
    ],
    [
        $bm_mul($bm_neg(bl), tanScale),
        0
    ],
    [
        0,
        0
    ]
], true);

